import React, { useContext } from 'react';
import { ActiveSectionContext } from '../contexts/ActiveSectionContext';




function Home() {

  const currentSection = useContext(ActiveSectionContext);


  return (
    <>Home {currentSection}</>
  );
}

export default Home;
